import React from "react";
import "./Portfolio.css";

const Portfolio = () => {
  return (
    <section className="work container section" id="work">
      <h2 className="section__title">Recent works</h2>
      <div className="work__filters"></div>
    </section>
  );
};

export default Portfolio;
